<!DOCTYPE html>
<html lang="en">
  <head>
    <meta charset="UTF-8" />
    <meta http-equiv="X-UA-Compatible" content="IE=edge" />
    <meta name="viewport" content="width=device-width, initial-scale=1.0" />
    <link rel="stylesheet" href="../css/staff.css" />
    <link rel="stylesheet" href="../css/adminQaFeedbackManagement.css" />
  </head>
  <body>
    <div class="form-wrapper-cate">
      <div class="form-right-cate">
        <p class="title-cate">Staff</p>
      </div>
      <div class="qa-ad-scroll-table">
        <div class="qa-ad-table-data">
          <div class="qa-ad-fb-thead">
            <div class="qa-ad-thead-cell">Name</div>
            <div class="qa-ad-thead-cell">DOB</div>
            <div class="qa-ad-thead-cell">Tel</div>
            <div class="qa-ad-thead-cell">Address</div>
            <div class="qa-ad-thead-cell">E-mail</div>
            <div class="qa-ad-thead-cell">Position</div>
            <div class="qa-ad-thead-cell">Department</div>
            <div class="qa-ad-thead-cell">Description</div>
          </div>
          <div class="qa-ad-fb-tbody">
            <div class="qa-ad-tbody-cell" title="DOB">DOB</div>
            <div class="qa-ad-tbody-cell" title="Name">Name</div>
            <div class="qa-ad-tbody-cell" title="Tel">Tel</div>
            <div class="qa-ad-tbody-cell" title="Address">Address</div>
            <div class="qa-ad-tbody-cell" title="E-mail">E-mail</div>
            <div class="qa-ad-tbody-cell" title="Position">Position</div>
            <div class="qa-ad-tbody-cell" title="Department">Department</div>
            <div class="qa-ad-tbody-cell" title="Description">Description</div>
          </div>
        </div>
      </div>
    </div>
  </body>
</html>
